import React from 'react';
import ReactDOM from 'react-dom';
import {Router,Route,Link} from 'react-router';
import './index.css';
import App from './App';
import Home from './component/index';


ReactDOM.render(
  <Router>
  	<Route path='/' component={Home}/>
  	
  </Router>,
  document.getElementById('root')
);
